import React from 'react';
import './doorGame.css';

//Imports Pictures for rendering later
import robotDoor from './robot_door.svg';
import beachDoor from './beach_door.svg';
import spaceDoor from './space_door.svg';

const doorImage = {
    robot: robotDoor,
    beach: beachDoor,
    space: spaceDoor
};

class doorGame extends React.Component{
    constructor(props){
        super(props);
    }

    render(){
        return (
            <div className="door-row">
                <img id="door1" className="door-frame" src={this.props.doors[0].src}/>
                <img id="door2" className="door-frame" src={this.props.doors[1].src}/>
                <img id="door3" className="door-frame" src={this.props.doors[2].src}/>
          </div>
        );
    }
};

export default doorGame;
